import React, { useState } from 'react';

function App() {
  const [prompt, setPrompt] = useState('');
  const [wordCount, setWordCount] = useState('');
  const [genre, setGenre] = useState('');
  const [language, setLanguage] = useState('en');
  const [story, setStory] = useState('');

  const generateStory = async () => {
    const keywords = [prompt, genre];
    const response = await fetch('http://127.0.0.1:8000/generate_story/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        keywords,
        max_length: parseInt(wordCount),
        language,
      }),
    });
    const data = await response.json();
    setStory(data.story);
  };

  return (
    <div className="min-h-screen bg-blue-200 flex items-center justify-center px-4">
      <div className="bg-white p-8 rounded-2xl shadow-lg w-full max-w-xl space-y-6">
        <h1 className="text-2xl font-bold text-center text-purple-700">Story Generator</h1>

        <textarea
          className="w-full p-3 border border-gray-300 rounded-md resize-none"
          placeholder="Generate a story about.."
          rows={4}
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
        />

        <input
          type="number"
          className="w-full p-3 border border-gray-300 rounded-md"
          placeholder="Number of words for story"
          value={wordCount}
          onChange={(e) => setWordCount(e.target.value)}
        />

        <select
          className="w-full p-3 border border-gray-300 rounded-md"
          value={genre}
          onChange={(e) => setGenre(e.target.value)}
        >
          <option value="">Select Genre</option>
          <option value="Adventure">Adventure</option>
          <option value="Fantasy">Fantasy</option>
          <option value="Science Fiction">Science Fiction (Sci-Fi)</option>
          <option value="Mystery">Mystery</option>
          <option value="Thriller">Thriller</option>
          <option value="Horror">Horror</option>
          <option value="Drama">Drama</option>
          <option value="Romance">Romance</option>
          <option value="Comedy">Comedy</option>
          <option value="Crime">Crime</option>
          <option value="Historical Fiction">Historical Fiction</option>
          <option value="Mythology">Mythology</option>
          <option value="Paranormal">Paranormal</option>
          <option value="Superhero">Superhero</option>
          <option value="Post-Apocalyptic">Post-Apocalyptic</option>
        </select>

        <select
          className="w-full p-3 border border-gray-300 rounded-md"
          value={language}
          onChange={(e) => setLanguage(e.target.value)}
        >
          <option value="en">English</option>
          <option value="hi">Hindi</option>
          <option value="te">Telugu</option>
          <option value="ta">Tamil</option>
        </select>

        <button
          onClick={generateStory}
          className="w-full bg-purple-600 text-white py-3 rounded-md hover:bg-purple-700 transition"
        >
          Generate
        </button>

        <div className="bg-blue-100 p-4 rounded-md min-h-[100px] text-gray-800">
          {story ? <p>{story}</p> : <p className="text-gray-500">Your generated story will appear here...</p>}
        </div>
      </div>
    </div>
  );
}

export default App;
